// src/components/SongCard.jsx
export default function SongCard({ song }) {
  return (
    <div style={{ margin: "10px", padding: "10px", border: "1px solid #ddd", borderRadius: "8px", width: "200px" }}>
      <img src={song.cover} alt={song.title} style={{ width: "100%", borderRadius: "8px" }} />
      <h4>{song.title}</h4>
      <p>{song.artist}</p>
      <audio controls src={song.url}></audio>
    </div>
  );
}
